import React from "react";
import { Component} from 'react';

const Videocurrent = () => {
	return (
		<iframe align= "left" width="560" height="315" src="https://www.youtube.com/embed/y83x7MgzWOA" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
		);
}
export default Videocurrent;
